import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
//Importing pages
import Home from './Pages/Home/Home';

function App() {
  return (
    <div>
      <Router>
        {/*Setting the home path */}
        <Route path="/">
          <Home />
        </Route>
        {/*Setting the product path */}
        <Route path="/products">
          <Products />
        </Route>
      </Router>
    </div>
  );
}

export default App;
